Extreme Yachts: Series 1

Technology Documentary hosted by Chris Parson, published by Travel Channel UK in 2014 - English narration


Information
------------------------------

Extreme Yachts
In the series &quot;Extreme Yachts,&quot; viewers get an up-close look at some of the country's most amazing and unique vessels. The designers and nautical engineers of each ship will explain how they have created these superboats. The series features sleek classic sailing yachts to extreme ones with Italian bird's-eye maple staircases, service rooms, a captain's cabin and a helicopter pad. Rivaling Beverly Hills mansions, these top-of-the-line vessels are truly some of the best to ever hit the high seas.


1)  Northern Marine 
Northern Marine in Washington State combines the motor of a yacht with the fuel efficiency of a cruiser; Chris-Craft's crew continues making lavish and enduring sea vessels, Richmond Yachts in British Columbia creates the largest private yacht
AllSeas Yachts

2)  AllSeas 
AllSeas Yachts in San Diego builds a 92-foot luxurious steel modern marvel; Marquis Yachts in Pulaski, Wis., sets the unbeatable standard; Macatawa Bay Boat Works in Saugatuck, Mich., restores a 1960 Riva Ariston.

3)  Ocean Alexander 
Ocean Alexander creates a 120-foot seafaring palace, Viking constructs a tournament-grade sports fisher and Tartan's state-of-the-art mast system wins awards.

